import React from 'react';

const Contact = () => {
  return (
    <section className="contact-section p-6">
      <h2 className="text-2xl font-bold mb-4">Contact Section</h2>
      <p>This is the Contact component content.</p>
    </section>
  );
};

export default Contact;
